  input: '"TEXT","F3A","C00349431","This amendment is filed to address the following
    issue:  In our Pre-General report as originally filed, $15,000 was incorrectly
    reported as a transfer when it was in fact an offset to operating expenses.   It
    was reimbursement for the travel advance for the Vice Presidential event on behalf
    of the Rehberg Victory Committee.  Reference our check #3708 dated 9/21/06, payable
    to the Republican National Committee - see Rehberg for Congress 2006 October Quarterly
    Report.      BEST EFFORTS:  Our original solicitation includes a clear and conspicuous
    request for contributor information and informs the contributor of the requirements
    of federal law for the reporting of such information.  If the information is not
    provided, we make one follow-up, stand-alone effort to obtain this information,
    regardless of whether the contribution was solicited or not.  This effort occurs
    no later than 30 days after receipt of the contribution and is in the form of
    a written request.    The follow-up request clearly asks for the missing information,
    without soliciting a contribution; informs the contributor of the requirements
    of federal law for reporting such information; and is in the form of a postage-paid,
    pre-addressed postcard.  Follow-up phone calls are also made to obtain the information.  Upon
    receipt of the information, it is entered as contributor information update and
    is reported as a memo item for the reporting period during which the updated information
    is received."'
